Step-by-step reasoning:

1. Key psychological mechanisms: We assume that responders value both the absolute monetary reward (split_self) and the fairness of its distribution relative to a fairness benchmark computed from token contributions. In other words, responders compare the actual share offered (split_self) with the “fair” share (r) that they expect based on their token contribution relative to the total of tokens, and their utility is adjusted based on how far the offer deviates from this expectation. A bounded, smoothly saturating function (tanh) is used to capture the idea that for extreme deviations the additional salience “levels off.”

2. Interaction of mechanisms: The utility is composed additively of the offered money and an adjustment term. The adjustment term is computed by first calculating a fairness benchmark r, then the normalized difference D = (split_self – r)/r; this difference is passed through a hyperbolic tangent (tanh) function. The idea is that small deviations induce proportional modifications of utility, while large deviations saturate at ±1. The learnable parameter lambda scales this fairness sensitivity. An additive baseline bias term mu is also included.

3. Mathematical form: The final utility is given by  
  U = mu + split_self + lambda · tanh((split_self – r)/r)  
where r is the fairness benchmark: r = combined_earning · (token_self/(token_self + token_opp)).

4. Learnable parameters: We have two learnable parameters. The first is mu, an overall bias. The second is lambda, the fairness sensitivity weight. Numerical bounds for mu are set generously (e.g., between –100 and 100), and lambda is constrained to be positive (e.g., from 0 to 100).

5. Mapping to observable behavior: The observable variables (split_self, combined_earning, token_self, token_opp) from the dataset are used to determine the fairness expectation (r) and the relative difference (D) from the actual offer. The model uses these to compute the utility of an accepted offer. Negative utility reflects an aversive valuation while positive utility indicates attractiveness, consistent with making or accepting a response.

Below is the formal specification:

