def simulate_model(trial_data, mu=0, lambd=1):
    utility_values = []
    for trial in trial_data:
        try:
            combined_earning = trial['combined_earning']
            token_self = trial['token_self']
            token_opp = trial['token_opp']
            split_self = trial['split_self']

            r = combined_earning * (token_self / (token_self + token_opp)) if (token_self + token_opp) !=0 else 0 #Handle division by zero

            if r != 0:
                D = (split_self - r) / r
            else:
                D = 0 #Handle division by zero

            U = mu + split_self + lambd * math.tanh(D)
            utility_values.append(U)
        except (KeyError, TypeError) as e:
            print(f"Error processing trial {trial}: {e}")
            utility_values.append(float('nan')) #Handle missing data

    return utility_values
